import { useNavigate } from "react-router-dom";
import { RiCheckboxCircleLine } from "react-icons/ri";
import { motion } from "framer-motion";

export default function KYCStep5() {
  const navigate = useNavigate();

  const handleFinish = () => {
    navigate("/dashboard"); // Redirect to dashboard/home
  };

  return (
    <div className="min-h-screen flex justify-center items-center bg-gradient-to-br from-blue-50 to-white p-4">
      <motion.div
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.5 }}
        className="w-full max-w-md bg-white p-8 rounded-2xl shadow-2xl border border-gray-200 text-center"
      >
        <RiCheckboxCircleLine className="text-green-500 text-6xl mx-auto mb-4" />
        <h1 className="text-3xl font-extrabold mb-4 text-gray-800">KYC Completed</h1>
        <p className="mb-6 text-gray-600">Thank you for completing your KYC process. Your documents are under verification.</p>
        <button
          onClick={handleFinish}
          className="w-full bg-blue-700 hover:bg-blue-800 text-white font-semibold py-3 rounded-xl shadow-lg transition duration-300"
        >
          Finish
        </button>
      </motion.div>
    </div>
  );
}
